'use strict';

angular.module('venti')
    .controller('SingleCtrl', function ($scope, $log, $routeParams, OrdersFactory, UserFactory, $location) {
        if(!UserFactory.user.displayName){
            $location.path("/");
            return;
        }
        $scope.helper.list = false;

        var id = $routeParams.id;
        OrdersFactory.getOrder(id).then(function (data) {
            $scope.order = data;
        });
        $scope.reuse = function (id) {
            $location.path("new/" + id);
        }
        $scope.edit = function (val) {
            $scope.helper.edit = val;
            $scope.order.datum = new Date($scope.order.datum);
            $scope.order.datumOd = new Date($scope.order.datumOd);
            $scope.order.datumDo = new Date($scope.order.datumDo);

            console.log($scope.order);
            OrdersFactory.putOrder($scope.order).then(function (data) {
                console.log(data);
            });
        }
        $scope.dateOptions = {
            changeYear: true,
            changeMonth: true,
            yearRange: '2000:-0',
            showAnim: "fadeIn",
            dateFormat: 'dd.mm.yy'
        };
        $scope.downloadFile = function () {
            var date = new Date($scope.order.datum),
                datumod = new Date($scope.order.datumOd),
                datumdo = new Date($scope.order.datumDo),
                datumodmj = parseInt(datumod.getMonth(), 10) + 1,
                datumdomj = parseInt(datumdo.getMonth(), 10) + 1;
            var docDefinition = {
                content: [
                    {
                        image: 'data:image/jpeg;base64,'
                        ,width: 520
                    },
                    {
                        columns: [
                            {
                                width: 320,
                                stack: ['Izvještaj o radu',"GODINA" + date.getFullYear() +  ". / BR. " + date.getFullYear() + "-" + $scope.order._id ],
                                style: 'headFont'
                            },
                            {
                                width: '*',
                                stack: ['Fakturiranje iz:',"Venti d.o.o.","K. Trpimira 55b", "Varaždin", "42000"],
                                style: 'subHead'
                            }
                        ]
                    },
                    { text: '', style: 'subHead',margin: [ 0, 20, 0, 0 ]},
                    { text: 'NARUČITELJ', style: 'subHead',margin: [ 0, 10, 0, 0 ]},
                    { text: $scope.order.narucitelj, style: 'paragraph' },
                    { text: 'Adresa', style: 'subHead',margin: [ 0, 10, 0, 0 ]},
                    { text: $scope.order.adresa, style: 'paragraph' },
                    { text: 'Izvođeno od ' + datumod.getDate() + "." + datumodmj + "." + datumdo.getFullYear() + ". do " + datumdo.getDate() + "." + datumdomj + "." + datumdo.getFullYear() + "." , style: 'subHead',margin: [ 0, 10, 0, 0 ]},
                    { text: 'Predstavnik', style: 'subHead',margin: [ 0, 10, 0, 0 ]},
                    { text: $scope.order.predstavnik, style: 'paragraph' },
                    { text: 'Telefon', style: 'subHead',margin: [ 0, 10, 0, 0 ]},
                    { text: $scope.order.telefon, style: 'paragraph' },
                    { text: 'Napomena', style: 'subHead',margin: [ 0, 10, 0, 0 ]},
                    { text: $scope.order.napomena, style: 'paragraph' },
                ],

                styles: {
                    headFont: {
                        fontSize: 17,
                        bold: true
                    },
                    subHead:{
                        fontSize: 15,
                        bold: true
                    },
                    paragraph:{
                        fontSize: 13,
                        bold: false
                    }
                }
            };
            pdfMake.createPdf(docDefinition).open();
        }
    });
